import type {NextPage} from 'next'
import {useRouter} from "next/router";
import {useState} from "react";
import {uploadImage} from "../firebase/client";
import Image from "next/image";
import store from "../store/store";
import {FormElements} from "../shared/bootstrap/form/FormElements";
import {useForm} from "../shared/utils/forms/useForm";
import BtnPrimary from "../shared/bootstrap/button/primary/BtnPrimary";
import BtnDanger from "../shared/bootstrap/button/danger/BtnDanger";
import BtnSecondary from "../shared/bootstrap/button/secondary/BtnSecondary";
import {IconSVG} from "../shared/ui/icon/IconSVG";
import {createStructureForm, createValidationsForm} from "../shared/utils/forms/useStructureForm";
import {getArrayByNumber} from "../shared/utils/arrayUtils";
import {copyObject} from "../shared/utils/objUtils";
import {email, required} from "../shared/utils/forms/utils/validationType";
import {saveFormData} from "../services/saveForm";
import {colorTheme} from "../shared/colorUtils";

const Home: NextPage = () => {
    const router = useRouter();
    const [index, setIndex] = useState(0);


    const calcValue = () => {
        return (index + 1) * 200;
    }


    const structureFormAdd = createStructureForm(
        [
            {
                pharmacies: getArrayByNumber(index + 1).map(ele => ({
                    name: ele.toString(),
                    type: 'textarea',
                    label: 'Farmacia da escludere',
                    dataElement: {type: 'text', placeholder: 'Testo da inserire'},
                    display: {
                        form: '',
                        label: '',
                        child: '',
                    },
                }))
            }
        ]
    )

    const structureForm = [
        {
            name: 'firstName',
            type: 'input',
            label: 'Nome',
            dataElement: {type: 'text', placeholder: 'Nome'}
        },
        {
            name: 'lastName',
            type: 'input',
            label: 'Cognome',
            dataElement: {type: 'text', placeholder: 'Cognome'}
        },
        {
            name: 'email',
            type: 'input',
            label: 'Email',
            dataElement: {type: 'text', placeholder: 'Email'}
        },
        {
            name: 'phone',
            type: 'input',
            label: 'Cellulare',
            dataElement: {type: 'text', placeholder: 'Numero Cellulare'}
        }


    ]
    const submitForm = (event: any, data: any) => {

        saveFormData(data).then(res => {
            console.log(res)
        });

    }


    const validationForm = createValidationsForm(
        [{
            name: 'firstName',
            validations: [
                {
                    name: required, params: {
                        name: 'Nome'
                    }
                }
            ]
        },
            {
                name: 'lastName',
                validations: [
                    {
                        name: required, params: {
                            name: 'Cognome'
                        }
                    }
                ]
            },
            {
                name: 'email',
                validations: [
                    {
                        name: required, params: {
                            name: 'Email'
                        }
                    },
                    {
                        name: email,
                        params: {
                            name: 'email'
                        }
                    }
                ]
            },
            {
                name: 'phone',
                validations: [
                    {
                        name: required, params: {
                            name: 'Cellulare'
                        }
                    }
                ]
            },
            {
                pharmacies: [
                    {
                        name: '0',
                        validations: [
                            {
                                name: required, params: {
                                    name: 'Farmacia'
                                }
                            }
                        ]
                    }
                ]
            }
        ]
    )

    const {
        dataForm,
        dataFormatted,
        setData,
        changeValue,
        submitAction,
        errors,
        isSubmit
    } = useForm(submitForm, validationForm)

    const addInput = () => {
        if (dataFormatted?.pharmacies && dataFormatted.pharmacies[index]) {
            setIndex(index + 1)
        }

    }
    const removeInput = () => {
        if (index > 0) {
            const copyDataFormatted = copyObject(dataFormatted)
            copyDataFormatted.pharmacies.splice(index, 1)
            setData(copyDataFormatted)
            setIndex(index - 1)
        }
    }

    return (<div>
            <div className="navbar navbar-expand-lg navbar-dark bg-gray">
                <div className="container">
                    <div className="row">
                        <div className="col-12 p-2">
                            <img
                                src={'data:image/png;base64,'}
                                height="60"/>
                        </div>
                    </div>
                </div>
            </div>
            <div className="container mt-4">
                <div className={"row justify-content-center mb-4 px-3"}>
                    <h1 className={'text-center'}>Attenzione</h1>
                    <p className={'text-center'}>Riempi il modulo qui sotto e procedi a confermare la tua email</p>
                    <div className={"col-12 col-lg-7 col-md-10 bg-gray p-2 p-md-5 "}>
                        <form onSubmit={submitAction}>
                            <FormElements structure={structureForm} errors={errors} isSubmit={isSubmit}
                                          changeValue={changeValue} dataForm={
                                dataForm
                            }/>
                            <div className="row align-items-end position-relative">
                                <div className="col">
                                    <FormElements structure={structureFormAdd} errors={errors} isSubmit={isSubmit}
                                                  changeValue={changeValue} dataForm={
                                        dataForm
                                    }/>
                                </div>
                                {
                                    index > 0 &&
                                    <div className="col-auto"
                                         style={{'position': 'absolute', right: 0, bottom: '17px'}}>
                                        <BtnDanger onClick={removeInput} className={''} variant={'danger-outline'}
                                                   style={{boxShadow: 'none'}}>
                                            <IconSVG icon={'trash'} tintColor={'#d84a38'}/>
                                        </BtnDanger>
                                    </div>
                                }
                            </div>
                            <BtnPrimary onClick={addInput} className={'w-100'} variant={'primary-outline'}
                                        disabled={!dataFormatted.pharmacies || !dataFormatted.pharmacies[index]}>
                                <IconSVG icon={'add'} tintColor={'#0062a7'} className={'me-2'}/> Farmacia da
                                escludere
                            </BtnPrimary>

                            <div className="row mt-5 ">
                                <div className="col-12">
                                    <BtnPrimary type={'submit'}
                                                disabled={!dataFormatted.pharmacies || !dataFormatted.pharmacies[index]}
                                                className={'w-100'}>
                                        Invia il pagamento di {calcValue()} €
                                    </BtnPrimary>
                                </div>
                            </div>
                        </form>
                    </div>


                </div>
            </div>
            <footer className="mt-auto bg-dark text-center text-lg-start bg-black">
                <div className="text-center text-white p-3"> © 2022
                    Copyright: <a className="text-white" target="_blank" href="https://farmamico.com/">Farmamico.com</a>
                </div>
            </footer>
        </div>
    )
}

export default Home
